import './App.scss';
import {BrowserRouter, Route } from "react-router-dom";
import Header from "./components/header/header";
import Routersconfig from "./config/Routersconfig";
import Footer from "./components/footer/footer";

function App() {
  return (
      <div className="App">
          <Route render={props => (
              <>
                  <Header {...props}/>
                  <Routersconfig/>
                  <Footer/>
              </>
          )}/>
      </div>
  );
}

export default App;
